  raw.trim()
     .split(/~|\n/)
     .map(s => s.trim())
     .filter(Boolean)
     .forEach(item => {
       let lat, lon, city, code;
       if (item.includes(':')) {
         [lat, lon, city, code] = item.split(':');
       } else {
         const parts = item.split(/\s+/);
         lat  = parts.shift();
         lon  = parts.shift();
         code = parts.pop();
         city = parts.join(' ');
       }
       if (!code || coords[code]) return;
       coords[code] = { lat: +lat, lon: +lon, city };
     });

  /* ─────────────────────── GLOBALS ─────────────────────── */
  const CABINS = ['economy', 'premium', 'business', 'first'];
  const markers = [];           // L.marker list
